/**
 * Represents base type for temporal data in ledger.
 * Contains `moment` field which contains timestamp
 * represented as UTC in ISO format.
 */
export type LedgerTemporal = {
    /**
     * UTC timestamp expressed as string in ISO 8601 format.
     * For example '2024-02-06T21:09:49.210Z'
     */
    moment: string;
};
